import React, { Component } from 'react';

class Login extends Component {

  state = {
    email: '',
    password: ''
  }

  render() {
    return (
      <div>

        <form>
          <label> Email: </label>
          <input type="text" name="email"></input>

          <label> Password: </label>
          <input type="text" name="password"></input>

          <button> Login </button>
        </form>

      </div>
    );
  }
}

export default Login;
